        {
            Density kilogrampercubicmeter = Density.FromKilogramsPerCubicMeter(1);
            Assert.AreEqual(0, kilogrampercubicmeter.CompareTo(kilogrampercubicmeter));
            Assert.Greater(kilogrampercubicmeter.CompareTo(Density.Zero), 0);
